"use strict";(globalThis.webpackChunknumerology=globalThis.webpackChunknumerology||[]).push([[849],{6164(e){e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","href":"/docs/Intro","label":"Intro","docId":"Intro","unlisted":false},{"type":"category","label":"Basics","collapsible":true,"collapsed":true,"items":[{"type":"link","href":"/docs/Basics/Birthday number","label":"Birthday number","docId":"Basics/Birthday number","unlisted":false},{"type":"link","href":"/docs/Basics/Chart","label":"Chart","docId":"Basics/Chart","unlisted":false},{"type":"link","href":"/docs/Basics/Core","label":"Core","docId":"Basics/Core","unlisted":false},{"type":"link","href":"/docs/Basics/Expression","label":"Expression","docId":"Basics/Expression","unlisted":false},{"type":"link","href":"/docs/Basics/Life Path","label":"Life Path","docId":"Basics/Life Path","unlisted":false},{"type":"link","href":"/docs/Basics/Master Numbers","label":"Master Numbers","docId":"Basics/Master Numbers","unlisted":false},{"type":"link","href":"/docs/Basics/Personality","label":"Personality","docId":"Basics/Personality","unlisted":false},{"type":"link","href":"/docs/Basics/Soul Urge","label":"Soul Urge","docId":"Basics/Soul Urge","unlisted":false}]},{"type":"category","label":"Meanings","collapsible":true,"collapsed":true,"items":[{"type":"link","href":"/docs/Number meanings/1","label":"1","docId":"Number meanings/1","unlisted":false}]},{"type":"category","label":"Numerology systems","collapsible":true,"collapsed":true,"items":[{"type":"link","href":"/docs/Systems/Chaldean numerology","label":"Chaldean numerology","docId":"Systems/Chaldean numerology","unlisted":false},{"type":"link","href":"/docs/Systems/Pythagorean numerology","label":"Pythagorean numerology","docId":"Systems/Pythagorean numerology","unlisted":false},{"type":"link","href":"/docs/Systems/Vedic numerology","label":"Vedic numerology","docId":"Systems/Vedic numerology","unlisted":false}]},{"type":"category","label":"Esoteric","collapsible":true,"collapsed":true,"items":[{"type":"link","href":"/docs/Esoteric/Angel numbers","label":"Angel numbers","docId":"Esoteric/Angel numbers","unlisted":false},{"type":"link","href":"/docs/Esoteric/Vibration","label":"Vibration","docId":"Esoteric/Vibration","unlisted":false}]}]},"docs":{"Basics/Birthday number":{"id":"Basics/Birthday number","title":"Birthday number","description":"In numerology, the Birthday number (also called Birth Day number) is simply the day of the month you were born, treated as its own special energy.","sidebar":"tutorialSidebar"},"Basics/Chart":{"id":"Basics/Chart","title":"Chart","description":"A chart (often called a numerology birth chart,numerology chart or numeroscope) is a structured layout of key numbers derived from your birth date and full birth name.  It serves as a \u201cmap\u201d of your personality, life path, strengths, challenges, and potential destiny, much like an astrological birth chart does for planets and signs.","sidebar":"tutorialSidebar"},"Basics/Core":{"id":"Basics/Core","title":"Core","description":"The \u201ccore\u201d refers to the five main numbers that form the foundation of your chart and are considered the most important influences in your life.","sidebar":"tutorialSidebar"},"Basics/Expression":{"id":"Basics/Expression","title":"Expression","description":"Expression number (also called the Destiny number or Personality number) is a Core number derived from the letters in your full birth name.","sidebar":"tutorialSidebar"},"Basics/Life Path":{"id":"Basics/Life Path","title":"Life Path","description":"Life Path number is considered the most important \u201ccore\u201d number in your chart; it is derived from your full date of birth and is said to reveal your life purpose, key traits, and the main lessons you are here to learn.","sidebar":"tutorialSidebar"},"Basics/Master Numbers":{"id":"Basics/Master Numbers","title":"Master Numbers","description":"Master Numbers are special double\u2011digit numbers that are not reduced to a single digit (1\u20139) because they\u2019re believed to carry a higher, more intense Vibration. The three main Master Numbers are 11, 22, and 33, and they often appear in core positions like Life Path, Expression, or Soul Urge numbers.","sidebar":"tutorialSidebar"},"Basics/Personality":{"id":"Basics/Personality","title":"Personality","description":"Personality Number (also called the \u201couter personality\u201d or \u201cfirst impression\u201d number) shows how you naturally come across to others and how people tend to see you before they really know you. It is one of the Core numbers in a numerology Chart, alongside Life Path, Expression, and Soul Urge.","sidebar":"tutorialSidebar"},"Basics/Soul Urge":{"id":"Basics/Soul Urge","title":"Soul Urge","description":"Soul Urge (also called Heart\u2019s Desire or Soul Number) reveals what you truly long for on the inside: your deepest desires, motivations, and emotional needs.\xa0 It shows what feels most meaningful to you, even if it doesn\u2019t match how you appear on the outside.","sidebar":"tutorialSidebar"},"Esoteric/Angel numbers":{"id":"Esoteric/Angel numbers","title":"Angel numbers","description":"Angel numbers in numerology are repeating number sequences, like 111 or 222, believed to carry messages from spiritual guides or the universe. They appear in everyday life\u2014on clocks, receipts, or license plates\u2014and are interpreted as signs of guidance, often linked to personal growth or alignment.","sidebar":"tutorialSidebar"},"Esoteric/Vibration":{"id":"Esoteric/Vibration","title":"Vibration","description":"In numerology, vibrations refer to the idea that each number carries a distinct energetic quality or frequency that influences people, names, dates, and events.\xa0 Practitioners treat numbers not just as abstract symbols but as living patterns of energy\u2014like musical notes\u2014that shape personality traits, life experiences, and spiritual lessons.","sidebar":"tutorialSidebar"},"Intro":{"id":"Intro","title":"Intro","description":"Welcome to my Numerology Wiki!","sidebar":"tutorialSidebar"},"Number meanings/1":{"id":"Number meanings/1","title":"1","description":"1 is just awesome.","sidebar":"tutorialSidebar"},"Systems/Chaldean numerology":{"id":"Systems/Chaldean numerology","title":"Chaldean numerology","description":"Chaldean numerology is an ancient system of numerology that originated in Mesopotamia (modern\u2011day Iraq) and is often described as one of the oldest known forms of name\u2011based numerology.\xa0 It focuses on the vibrational energy of letters in a name and how those vibrations influence a person\u2019s character, destiny, and life events.","sidebar":"tutorialSidebar"},"Systems/Pythagorean numerology":{"id":"Systems/Pythagorean numerology","title":"Pythagorean numerology","description":"Pythagorean numerology is a Western system of numerology based on the ideas of the ancient Greek philosopher and mathematician Pythagoras, who taught that numbers are the fundamental building blocks of reality and carry spiritual or \u201cvibrational\u201d meaning.\xa0 It is also commonly called modern or Western numerology and is one of the most widely used numerology systems today.","sidebar":"tutorialSidebar"},"Systems/Vedic numerology":{"id":"Systems/Vedic numerology","title":"Vedic numerology","description":"Vedic numerology (also called Indian or Hindu numerology) is a traditional system from the Vedic\u2011astrology tradition of India that interprets numbers derived from your birth date and name as carriers of planetary energy and karmic patterns.\xa0 It treats numbers as vibrations linked to the nine planets (Navagrahas), so each digit from 1 to 9 is associated with a specific planet and set of qualities.","sidebar":"tutorialSidebar"}}}}')}}]);